import Login from "./login";
import Register from "./register";

export default function LoginAndRegister() {
    return(
        <div>
            <h2>Login</h2>
            <Login />
            <br />
            <hr />
            <br />
            <h2>Register</h2>
            <Register />
        </div>
    )
}
